CREATE DEFINER=`root`@`localhost` FUNCTION `date_aleatoire`(date_min DATE, date_max DATE) RETURNS date
BEGIN
RETURN (
        SELECT
            DATE(
                DATE_ADD(
                    date_min,
                    INTERVAL FLOOR(
                        RAND() * DATEDIFF(date_max, date_min)
                    ) DAY
                )
            )
    );

END ;;
DELIMITER ;
