CREATE DEFINER=`root`@`localhost` FUNCTION `date_aleatoire_nullable`(date_min DATE, date_max DATE) RETURNS date
BEGIN DECLARE alea FLOAT;

SET alea = rand();

IF alea < 0.5 THEN RETURN NULL;

ELSE RETURN date_aleatoire(date_min, date_max);

END IF;

END ;;
DELIMITER ;
