CREATE DEFINER=`root`@`localhost` FUNCTION `GET_RANDOM_NATIONALITE`() RETURNS varchar(50) CHARSET utf8mb4 COLLATE utf8mb4_general_ci
BEGIN 
	DECLARE nationalite VARCHAR(50);
	DECLARE alea FLOAT;
	SET alea = rand();
	SET
	    nationalite = case
	        when alea < 0.1 then 'belge'
	        when alea < 0.2 then 'franais'
	        when alea < 0.3 then 'amricain'
	        when alea < 0.4 then 'allemand'
	        when alea < 0.5 then 'russe'
	        when alea < 0.6 then 'ukrainien'
	        when alea < 0.7 then 'italien'
	        when alea < 0.8 then 'espagnol'
	        else 'autre'
END; 

RETURN nationalite;

END ;;
DELIMITER ;
