CREATE DEFINER=`root`@`localhost` FUNCTION `nombre_aleatoire`(nombre_min INT, nombre_max INT) RETURNS int(11)
BEGIN
RETURN (
        SELECT
            FLOOR(
                RAND() * (nombre_max - nombre_min + 1)
            ) + nombre_min
    );

END ;;
DELIMITER ;
