CREATE DEFINER=`root`@`localhost` FUNCTION `populate_emprunt`(nombre_emprunts INT) RETURNS varchar(255) CHARSET utf8mb4 COLLATE utf8mb4_general_ci
BEGIN DECLARE i INT DEFAULT 0;

DECLARE date_emprunt DATE;

DECLARE date_retour DATE;

DECLARE nombre_lecteurs INT;

DECLARE nombre_exemplaires INT;

DECLARE lecteur_id INT;

DECLARE exemplaire_id INT;

SELECT COUNT(*) INTO nombre_lecteurs FROM lecteur;

SELECT COUNT(*) INTO nombre_exemplaires FROM exemplaire;

IF nombre_exemplaires > 0 THEN
WHILE i < nombre_emprunts
DO
SET date_emprunt = (
        SELECT
            date_aleatoire('2022-01-01', CURRENT_DATE())
    );

SET date_retour = (
        SELECT
            date_aleatoire_nullable(date_emprunt, CURRENT_DATE())
    );

SET lecteur_id = (
        SELECT
            nombre_aleatoire(1, nombre_lecteurs)
    );

SET @exemplaire_id = (
        SELECT
            nombre_aleatoire(1, nombre_exemplaires)
    );

WHILE
    @exemplaire_id IN (
        SELECT exemplaire_id
        FROM emprunt
        WHERE
            date_retour IS NULL
            AND exemplaire_id = @exemplaire_id
    )
DO
SET
    @exemplaire_id = (
        SELECT
            nombre_aleatoire(1, nombre_exemplaires)
    );

END WHILE;

INSERT INTO
    emprunt (
        date_emprunt,
        date_retour,
        lecteur_id,
        exemplaire_id
    )
VALUES (
        date_emprunt,
        date_retour,
        lecteur_id,
        @exemplaire_id
    );

SET i = i + 1;

END WHILE;

ELSE SET nombre_emprunts = 0;

END IF;

RETURN
    CONCAT(
        nombre_emprunts,
        ' emprunts alatoires ont t ajouts  la table emprunt'
    );

END ;;
DELIMITER ;
