CREATE DEFINER=`root`@`localhost` FUNCTION `populate_exemplaire`(nombre_exemplaires INT) RETURNS varchar(255) CHARSET utf8mb4 COLLATE utf8mb4_general_ci
BEGIN DECLARE i INT DEFAULT 1;

DECLARE reference VARCHAR(50) ;

DECLARE rayon VARCHAR(50) ;

DECLARE date_acquisition DATE ;

DECLARE etat VARCHAR(50);

DECLARE est_perdu BOOLEAN;



DECLARE nombre_livres INT;

SELECT COUNT(*) INTO nombre_livres FROM livre;

SET est_perdu = 0;



IF nombre_livres > 0
AND nombre_exemplaires <= nombre_livres THEN
WHILE
    i <= nombre_exemplaires
DO
SET
    reference = CONCAT('REF', i);

SET rayon = CONCAT('RAYON', i);

SET date_acquisition = (
        SELECT
            date_aleatoire('2022-01-01', CURRENT_DATE())
    );

SET
    etat = case
        when rand() < 0.1 then 'mauvais'
        when rand() < 0.2 then 'bon'
        when rand() < 0.3 then 'neuf'
        else 'moyen'
        
    END;

SET @livre_id = (SELECT nombre_aleatoire(1,nombre_livres));

WHILE @livre_id IN (
        SELECT livre_id
        FROM exemplaire
    )
DO
SET @livre_id = (
        SELECT
            nombre_aleatoire(1, nombre_livres)
    );

END WHILE;

INSERT INTO
    exemplaire (
        reference,
        rayon,
        date_acquisition,
        etat,
        est_perdu,
        livre_id
    )
VALUES (
        reference,
        rayon,
        date_acquisition,
        etat,
        est_perdu,
        @livre_id
    );

SET i = i + 1;

END WHILE;

ELSE SET nombre_exemplaires = 0;

END IF;

RETURN
    CONCAT(
        nombre_exemplaires,
        ' exemplaires alatoires ont t ajouts  la table exemplaire'
    );

END ;;
DELIMITER ;
